Absolutely amazing day on the water Saturday. @captbojohnson and I celebrated 13yrs together the only way we know how 🦈🎣🚤😎🌊. We told ourselves we were only gonna fish for numbers to make it fun for Gage but hey when the opportunity presents, it presents.. I think word has got out in the shark world about this shark captain Bo and they all wanna get a photo with him lol. I was worried it would be too long/ tough for Gage considering we had this good bit of a cow nose Ray bait and we were in the pass 🤔🙄 BUT he said he wanted to go for the shark. The moment I heard the line peeling I jumped on the tower to run the boat hehe getcha some of that big shark rod bend Bo Johnson. Gage stayed on the rod in the fighting chair the entire time. I was so proud!! Thank you @hill_tide_fishing_charters / @kyla_mccafferty_ @r_shelton07 for being there to capture the moment! I finally made Bo’s profile pic again after all these years 😂. After the shark we hit the beach for some snook, skim board and volleyball action. The weather could not have been more perfect. Grateful for the amazing day!! 🩵🙏
