Harvested my 2nd best archery buck 🏹🦌🙌
Really happy with my shot. Sure is crazy how sitting in the stand can go from the most peaceful / relaxed -TO- heart pounding out your eardrums, saying Bible verses to calm down and praying to make an efficient shot. When this chocolate beauty came in - I gave it about .5 second assessment and went to complete shit knowing I was gonna go for it. He gave me broadside at 20yds, took the step and I let her fly. Thwack! Looked like a good hit. But I saw the arrow stick (no pass through) and my heart jumped in my throat. I stayed glued on em as he hauled ass and then lost em behind some trees. Do I let him be? Do I wait? Yeh, negative lol I had to see what happened. Knocked another arrow, attached the quiver, got the range finder and binocs and shaky wobbled to the ground. I started replaying the shot/ angle he ran off and was like ohhhh no .. where is the blood!? I went back to start and trail a few times in diff directions and just was not getting on the blood. Well shit.. maybe it’s the no pass through. So I just start fan walking and then BAM! Not 60 yds from where I shot, my buck is taking a solid dirt nap with a double lung hit and a ton of blood. Wow! I did it!!! This is really happening woohooo!!!! My 2nd biggest bow kill here in Texas 🙏. It was my first time shooting an expandable broadhead (RAGE), and although I’m pulling about 60lbs on my Hoyt carbon defiant, the arrow looks to have hit the opposite shoulder. When we gutted em, it was evident the cavity was filled with blood so the arrow did its job. (I know the whole debate with fixed vs expandable broadheads and would love some feedback in the comments). But the bottom line is the evening was a success and I couldn’t be happier to share in it with my family and friends here in Texas. Thank you @micah.mckinney and @kathleenkennedy77 !!

